description.en:
A cute one-volume story about a girl who loves dolphins (her father runs the aquarium where they live) and visits them often at a local theme park. She becomes interested in a brooding young man, without realizing that his family owns the theme park where her beloved dolphins live, and whose father may be shutting the aquarium down&hellip;

Italiano:
Una bella storia di una ragazza che ama i delfini (suo padre gestisce l'acquario dove vivono quegli animali) e fa loro spesso visita. La protagonista comincia ad interessarsi ad un giovane, senza rendersi conto che la famiglia del ragazzo &egrave; la proprietaria del parco dove vivono i suoi amati delfini e forse &egrave; proprio il padre di quello sconosciuto che vuole far fallire l'acquario...
